import React from 'react'
import styled from 'styled-components'


function Login() {
  return (
  <Background>
      <Text>Login</Text>
      <InfoFields>

      </InfoFields>
  </Background>
  );
}

export default Login

const Background = styled.section`
background-color: #282c34;
min-height: 100vh;
display: flex;
flex-direction: column;
font-size: calc(10px + 2vmin);
`

const InfoFields = styled.view`
    border:black;
`


const Text = styled.p`
color:white;
text-align:center;
`;
